import React from 'react'
import ReactDOM from 'react-dom'


const NoteExample = (props) => {
  const { notes } = props

  const rows = () => 
    notes.map(note => <li> {note.content}</li>)

  return (
    <div>
      <h1>Notes</h1>
      <ul>
       {rows()}
      </ul>
    </div>
  )
}

export default NoteExample
